const METADATA =
{
    author: "DennouNeko",
    name: "Sorters",
    version: "v1.0.0",
    website: "https://github.com/DennouNeko/shapez-sorters",
    id: "sorters",
    description: "Advanced version of filters, with actual filtering",
    minimumGameVersion: ">=1.5.0",
};

// == configuration variables ==

// When true, a small box with filtered item will appear on top of building (when not null)
const doDrawItem = true;


// == actual code beyond this point ==

// Declare a new type of item processor
shapez.enumItemProcessorTypes.sorter = "sorter";
shapez.enumItemProcessorTypes.invSorter = "inv_sorter";


// For now, flipper always has the same speed
shapez.MOD_ITEM_PROCESSOR_SPEEDS[shapez.enumItemProcessorTypes.sorter] = () => 10;
shapez.MOD_ITEM_PROCESSOR_SPEEDS[shapez.enumItemProcessorTypes.invSorter] = () => 10;


shapez.MODS_CAN_PROCESS[shapez.enumItemProcessorTypes.sorter] = function (payload)
{
    const pinsComp = payload.entity.components.WiredPins;
    const network = pinsComp.slots[0].linkedNetwork;
    const pattern = (network && network.hasValue()) ? network.currentValue : null;
    
    if(pattern == null)
    {
        return false;
    }
    
    const processorComp = payload.entity.components.ItemProcessor;
    
    if(!processorComp.inputSlots.get(0))
    {
        return false;
    }
    
    return true;
};


// The actual sorting happens here: based on sorter type and input type we either let the item through or bounce it to the side.
// Comparing the wire input with item works kinda like the JS "===" comparison.
// If the inputs are of different types, the result is "false".
// Same if the items are of same type, but have different values.
// The only difference is for boolean wire input - it forces the comparison to the input value.
// For regular sorter if comparison returned "true", the items are redirected to the side, while "false" lets items pass.
// For inverted sorter, "true" means let items pass, "false" redirects them.
function doProcess(payload, invert)
{
    const inputItem = payload.items.get(0);
    const pinsComp = payload.entity.components.WiredPins;
    const network = pinsComp.slots[0].linkedNetwork;
    const filterItem = (network && network.hasValue()) ? network.currentValue : null;

    redirect = !invert;

    if(filterItem.getItemType() === "boolean")
    {
        redirect = !!(filterItem.value) ? !invert : invert;
    }
    else if(!filterItem.equals(inputItem))
    {
        redirect = invert;
    }

    payload.outItems.push({
        item: inputItem,
        requiredSlot: redirect ? 1 : 0,
        doNotTrack: true,
    });
}


shapez.MOD_ITEM_PROCESSOR_HANDLERS[shapez.enumItemProcessorTypes.sorter] = function (payload)
{
    doProcess(payload, false);
};


shapez.MOD_ITEM_PROCESSOR_HANDLERS[shapez.enumItemProcessorTypes.invSorter] = function (payload)
{
    doProcess(payload, true);
};


const enumSorterVariants =
{
    sorterRight: shapez.defaultBuildingVariant, // TODO: replace with "sorter_right" once #1385 gets fixed...
    sorterLeft: "sorter_left",
    invSorterRight: "inv_sorter_right",
    invSorterLeft: "inv_sorter_left",
};


// Building and variant definitions.
class MetaSorter extends shapez.ModMetaBuilding
{
    constructor()
    {
        super("sorter");
    }

    static getAllVariantCombinations()
    {
        return [
            {
                variant: enumSorterVariants.sorterRight,
                name: "Sorter",
                description: "Items that match filter will go to right",

                regularImageBase64: RESOURCES["sorterRight.png"],
                blueprintImageBase64: RESOURCES["sorterRight.png"],
                tutorialImageBase64: RESOURCES["sorterRight.png"],
            },
            {
                variant: enumSorterVariants.sorterLeft,
                name: "Sorter",
                description: "Items that match filter will go to left",

                regularImageBase64: RESOURCES["sorterLeft.png"],
                blueprintImageBase64: RESOURCES["sorterLeft.png"],
                tutorialImageBase64: RESOURCES["sorterLeft.png"],
            },
            {
                variant: enumSorterVariants.invSorterRight,
                name: "Inverted Sorter",
                description: "Items that don't match filter will go to right",

                regularImageBase64: RESOURCES["invSorterRight.png"],
                blueprintImageBase64: RESOURCES["invSorterRight.png"],
                tutorialImageBase64: RESOURCES["invSorterRight.png"],
            },
            {
                variant: enumSorterVariants.invSorterLeft,
                name: "Inverted Sorter",
                description: "Items that don't match filter will go to left",

                regularImageBase64: RESOURCES["invSorterLeft.png"],
                blueprintImageBase64: RESOURCES["invSorterLeft.png"],
                tutorialImageBase64: RESOURCES["invSorterLeft.png"],
            },
        ];
    }

    getSilhouetteColor()
    {
        return "#804080";
    }

    getDimensions(variant)
    {
        return new shapez.Vector(1,1);
    }
    
    getShowWiresLayerPreview()
    {
        return true;
    }

    getAdditionalStatistics(root)
    {
        const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.balancer);
        return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(speed)]];
    }

    getIsUnlocked(root)
    {
        return root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_filter);
    }

    getAvailableVariants(root)
    {
        let available = [];
        if(root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_filter))
        {
            available.push(
                  enumSorterVariants.sorterRight,
                  enumSorterVariants.sorterLeft,
                  enumSorterVariants.invSorterRight,
                  enumSorterVariants.invSorterLeft
                );
        }

        return available;
    }

    setupEntityComponents(entity)
    {
        entity.addComponent(
            new SorterComponent()
        );

        entity.addComponent(
            new shapez.ItemAcceptorComponent({
                slots: [
                    {
                        pos: new shapez.Vector(0, 0),
                        direction: shapez.enumDirection.bottom,
                    },
                ],
            })
        );

        entity.addComponent(
            new shapez.ItemProcessorComponent({
                inputsPerCharge: 1,
                processorType: shapez.enumItemProcessorTypes.sorter,
                processingRequirement: shapez.enumItemProcessorTypes.sorter,
            })
        );

        entity.addComponent(
            new shapez.ItemEjectorComponent({
                slots: [], // WIll be updated later
                renderFloatingItems: true,
            })
        );

        entity.addComponent(
            new shapez.WiredPinsComponent({
                slots: [
                    {
                        pos: new shapez.Vector(0, 0),
                        direction: shapez.enumDirection.top,
                        type: shapez.enumPinSlotType.logicalAcceptor,
                    },
                ],
            })
        );
    }
    
    updateVariants(entity, rotationVariant, variant)
    {
        switch(variant)
        {
        case enumSorterVariants.sorterRight:
        case enumSorterVariants.invSorterRight:
            {
                entity.components.ItemEjector.setSlots([
                  { pos: new shapez.Vector(0,0), direction: shapez.enumDirection.top, },
                  { pos: new shapez.Vector(0,0), direction: shapez.enumDirection.right, },
                ]);
            }
            break;
        case enumSorterVariants.sorterLeft:
        case enumSorterVariants.invSorterLeft:
            {
                entity.components.ItemEjector.setSlots([
                  { pos: new shapez.Vector(0,0), direction: shapez.enumDirection.top, },
                  { pos: new shapez.Vector(0,0), direction: shapez.enumDirection.left, },
                ]);
            }
            break;
            
        default:
            assertAlways(false, "Unknown sorter variant: " + variant);
        }
        
        if((variant === enumSorterVariants.invSorterRight) || (variant === enumSorterVariants.invSorterLeft))
        {
            entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.invSorter;
        }
    }
    
    drawChunk(parameters, chunk)
    {
        debugger;
    }
}


// A dummy component to let the filtering work.
class SorterComponent extends shapez.Component
{
    static getId()
    {
        return "Sorter";
    }
}


// Overlay renderer system for our sorters.
class SorterOverlaySystem extends shapez.GameSystemWithFilter
{
    constructor(root)
    {
        super(root, [SorterComponent]);
        
        if(doDrawItem)
        {
            this.itemBox = shapez.Loader.getSprite(RESOURCES["itemBoxPath"]);
        }
    }
    
    drawChunk(parameters, chunk)
    {
        const contents = chunk.containedEntitiesByLayer.regular;
        for(let i = 0; i < contents.length; ++i)
        {
            const entity = contents[i];
            if(entity && entity.components.Sorter)
            {
                const pinsComp = entity.components.WiredPins;
                const staticComp = entity.components.StaticMapEntity;
                
                const network = pinsComp.slots[0].linkedNetwork;
                
                if(!network || !network.hasValue())
                {
                    continue;
                }
                
                const value = network.currentValue;
                const effectiveRotation = Math.radians(staticComp.rotation + shapez.enumDirectionToAngle[shapez.enumDirection.bottom]);
                
                const origin = staticComp.origin;
                const worldPos = new shapez.Vector(
                    (origin.x + 0.5) * shapez.globalConfig.tileSize,
                    (origin.y + 0.5) * shapez.globalConfig.tileSize
                );
                const offset = new shapez.Vector(0, -9.1).rotated(effectiveRotation);
                
                if(doDrawItem)
                {
                    this.itemBox.drawCachedCentered(
                        parameters,
                        worldPos.x + offset.x,
                        worldPos.y + offset.y,
                        12
                    );
                }
                
                value.drawItemCenteredClipped(
                    worldPos.x + offset.x,
                    worldPos.y + offset.y,
                    parameters,
                    (value.getItemType() === "color") ? 14 : 9
                );
            }
        }
    }
}


class Mod extends shapez.Mod
{
    init()
    {
        if(doDrawItem)
        {
            this.modInterface.registerSprite(RESOURCES["itemBoxPath"], RESOURCES["itemBox.png"]);
        }
        this.modInterface.registerComponent(SorterComponent);
        this.modInterface.registerGameSystem({
            id: "sorter_overlay",
            systemClass: SorterOverlaySystem,
            before: "end",
            drawHooks: ["staticAfter"],
        });
        this.modInterface.registerNewBuilding({
            metaClass: MetaSorter,
            buildingIconBase64: RESOURCES["sorterIcon.png"],
        });
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaSorter,
        });
    }
}

const RESOURCES = {
    "itemBoxPath":
        "sprites/misc/itemBox.png",
    "itemBox.png":
        "data:@file/png;base64,",
    "sorterIcon.png":
        "data:@file/png;base64,",
    "sorterLeft.png":
        "data:@file/png;base64,",
    "sorterRight.png":
        "data:@file/png;base64,",
    "invSorterLeft.png":
        "data:@file/png;base64,",
    "invSorterRight.png":
        "data:@file/png;base64,",
};

